let state = {
    pageProfile: {
        postsDt: [
            {
                id: 1,
                message: 'Hi, how are u?',
                likes: 12
            },
            {
                id: 2,
                message: 'Hi, everybody!',
                likes: 36
            },
            {
                id: 3,
                message: 'OK. And u?',
                likes: 26
            }
        ]
    },
    pageDialogues: {
        dialoguesDt: [
            {
                id: 1,
                name: 'Мария',
                avatar: 'avatar_1.png'
            },
            {
                id: 2,
                name: 'Антон',
                avatar: 'avatar_2.jpg'
            },
            {
                id: 3,
                name: 'Мартин',
                avatar: 'avatar_5.jpg'
            },
            {
                id: 4,
                name: 'Алексей',
                image: 'avatar_4.jpg'
            },
            {
                id: 5,
                name: 'Евгения',
                image: 'avatar_3.jpg'
            }
        ],
        messagesDt: [
            {
                id: 1,
                message: 'Hi!'
            },
            {
                id: 2,
                message: 'How r u?'
            },
            {
                id: 3,
                message: 'OK. And you?'
            }
        ]
    }
}

export default state;
